export const example: "<!DOCTYPE html>\n<html>\n\n<head>\n  <meta content=\"text/html;charset=utf-8\" http-equiv=\"Content-Type\">\n  <script crossorigin src=\"https://unpkg.com/react@17.0.1/umd/react.development.js\"></script>\n  <script crossorigin src=\"https://unpkg.com/react-dom@17.0.1/umd/react-dom.development.js\"></script>\n  <script src=\"https://unpkg.com/@babel/standalone@7.12.12/babel.min.js\"></script>\n  <title>Hello Example</title>\n  <style>\n    body {\n      margin: auto;\n      overflow-y: auto;\n    }\n  </style>\n</head>\n\n<body>\n  <div id=\"output\"></div>\n\n  <script type=\"text/jsx\">\n\n    const Hello = ({name}) => {\n      const [counter, setCounter] = React.useState(0);\n     \n      React.useEffect(()=>{\n        const cl =setInterval(()=>setCounter(x=>x+1), 1000);\n        \n        return ()=>clearInterval(cl);\n      },[]);\n\n      return <>\n        <h1>Hello {name}</h1>\n        <p>{counter}</p>\n      </>\n    }\n    ReactDOM.render(<Hello name=\"React\"/>, document.getElementById(\"output\"))\n\n</script>\n</body>\n<html>\n\n\n";
